a:260:{i:0;a:1:{s:2:"id";s:19:"2391072176062464670";}i:1;a:1:{s:10:"short_code";s:11:"CEuy3nGhgKe";}i:2;a:1:{s:12:"created_time";i:1599258037;}i:3;a:1:{s:7:"caption";s:1743:"C has been asking to go apple picking since December. I told him when summer was just about over and the combines were in the fields, we'd go apple picking. I thought it would help him realize how far away apple picking was. ‚Ä¢
‚Ä¢
‚Ä¢
Instead, he has asked if Summer is almost over EVERY WEEK since December! We live in the land of eternal winter {snow for 6 months minimum, sometimes even 7-8 months!}. We DO NOT ask if Summer is just about over üòÇ ‚Ä¢
‚Ä¢
‚Ä¢
I think both Philip and I have felt exasperated at times with his constant asking for apple picking, but the day FINALLY arrived and it was about the sweetest thing I've ever watched. ‚Ä¢
‚Ä¢
‚Ä¢
I took them to the Crap Apple tree at my grandparents farm {next door to my mom and dad} where I grew up picking apples. Watching C + B run around with their baskets and help each other fill them and snack on juicy apples was so much fun! And then they spent hours running around the farm with their cousins, picking garden veggies with their Bampa and Grandma and soaking in a beautiful late-summer-kinda-feels-like-fall day ‚ô•Ô∏è ‚Ä¢
‚Ä¢
‚Ä¢
I kept thinking how we needed to hurry up and get the babies home and get started on school, but then I watched all that they were learning and experiencing and I decided to just relax. There will be many winter days for school, but today, the memories of a lifetime were made. ‚Ä¢
‚Ä¢
‚Ä¢
And for a few hours, I remembered what it was like when life was simple, the cousins were many and all we did was chase each other all over the farm and hope mom wouldn't call us to do chores üòÇFor just a few hours, my boys got to live how I lived... which if I'm being completely unbiased, was the absolute best place and way to grow up ‚ô•Ô∏è";}i:4;a:1:{s:14:"comments_count";i:2;}i:5;a:1:{s:11:"likes_count";i:2;}i:6;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuy3nGhgKe";}i:7;a:1:{s:5:"image";s:247:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118770991_115286056828397_28917216331413467_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=-iT-ZBJuvtsAX-sMJck&oh=a86ce365e7bab2c96666063f0695de06&oe=5F7AAC9C";}i:8;a:1:{s:4:"type";s:7:"sidecar";}i:9;a:1:{s:8:"owner_id";i:1543439659;}i:10;a:1:{s:14:"owner_username";s:0:"";}i:11;a:1:{s:14:"owner_fullname";s:0:"";}i:12;a:1:{s:9:"owner_pic";s:0:"";}i:13;a:1:{s:2:"id";s:19:"2391071144409271644";}i:14;a:1:{s:10:"short_code";s:11:"CEuyomTM41c";}i:15;a:1:{s:12:"created_time";i:1599257914;}i:16;a:1:{s:7:"caption";s:301:"Beauty of nature

